import React from 'react';

const Edukacija = () => {
    return (
         <div className="edukacija">
             <div className="opis">
                 <h2>Едукација</h2>
                 <p>Компаниите имаат можност да ги надоградат своте тимови,а со тоа да го подобрат перформансот на својата компанија.
                     
                 </p>
             </div>
             <div className="slikaEdu"></div>
         </div>
         
         );
}
 
export default Edukacija;
